var exec = require('child_process').exec;

// TODO: I couldn't get this to work by calling the API directly since
// browserify ignored my files and provided no guidance as to what was
// going on.
function getBrowserifyBinary() {
  var browserifyRoot = require.resolve('browserify');
  var nodeModulesRoot = browserifyRoot.substring(
    0,
    browserifyRoot.indexOf('node_modules') + ('node_modules').length
  );
  var binRoot = nodeModulesRoot + '/.bin';
  return binRoot + '/browserify';
}

describe('staticify', function() {
  it('should work for jpgs and css', function() {
    var finished = false;
    runs(function() {
      exec(
        getBrowserifyBinary() + ' -t ./index.js ./spec/fixtures/root',
        function(error, stdout, stderr) {
          expect(stdout).toEqual(';(function(e,t,n){function i(n,s){if(!t[n]){if(!e[n]){var o=typeof require=="function"&&require;if(!s&&o)return o(n,!0);if(r)return r(n,!0);throw new Error("Cannot find module \'"+n+"\'")}var u=t[n]={exports:{}};e[n][0].call(u.exports,function(t){var r=e[n][1][t];return i(r?r:t)},u,u.exports)}return t[n].exports}var r=typeof require=="function"&&require;for(var s=0;s<n.length;s++)i(n[s]);return i})({1:[function(require,module,exports){\nrequire(\'./sample.jpg\');\nrequire(\'./test.css\');\n\nmodule.exports = \'hello world\';\n},{"./sample.jpg":2,"./test.css":3}],2:[function(require,module,exports){\nmodule.exports = "data:image/jpeg;base64,";\n\n},{}],3:[function(require,module,exports){\nvar node = document.createElement(\'style\');\nnode.innerHTML = ".myclass {\\n  background: red;\\n}";\ndocument.head.appendChild(node);\n\n},{}]},{},[1])\n;');
          finished = true;
        }
      );
    });
    waitsFor(function() {
      return finished;
    });
  });
});